def evaluateAgreement(output,family):
    if len(output)!=1:
        raise Exception
    agreement = dict(item.split(":") for item in output[0].split(","))
    tot = sum([int(x) for x in agreement.values()])
    return round(100*int(agreement[family])/tot,2)

def createSymbolic(df):
    _,df = df
    for sample,row in df.iterrows():
        subprocess.call(f"mkdir -p dataset/toSync/{row['family']} && ln -s {MALWARE_DIRECTORY}{row['family']}/{sample} dataset/toSync/{row['family']}/{sample}",shell=True)

def updateLabelDataFrame(experiment,sampleList):
    filepath = os.path.join(DATASET_DIRECTORY,experiment,'labels.pickle')
    dataset = pd.read_pickle(filepath)
    for sample,dictionary in sampleList.items():
        dataset.at[sample,'error'] = dictionary['error']
    dataset.to_pickle(filepath)

def getList(experiment,trainTest=False,validation=False,binary=False,maxSize=-1):
    dataset = pd.read_pickle(os.path.join(DATASET_DIRECTORY,experiment,'labels.pickle'))
    if not binary:
        dataset = dataset[~dataset.benign]
    sha1s = []
    if trainTest:
        sha1s.append(dataset[dataset.set=='trainTest'])
    if validation:
        sha1s.append(dataset[dataset.set=='validation'])
    returnDf = pd.concat(sha1s)

    if maxSize>0:
        returnDf = returnDf[returnDf.mb<=maxSize]

    returnDf = returnDf[returnDf.error.str.len()==0]
    tList = list(zip(returnDf.index,returnDf.family))
    return tList

def split(toSplit):
    splitting = {'trainTest':.80, 'validation':.20}
    groups = toSplit.groupby(['family','benign'])
    for _,df  in groups:
        l = list(df.index)
        samples = len(l)
        for spl_set,perc in splitting.items():
            select = samples*perc
            if select>len(l):
                select = len(l)
            current = random.sample(l,math.ceil(select))
            toSplit.loc[current,'set'] = spl_set
            l = [x for x in l if x not in current]
    return toSplit

def excludeBroken(toFilter):
    #Exclude broken samples
    brokenPath = os.path.join(DATASET_DIRECTORY,'staticFails')
    with open(brokenPath) as rFile:
        broken = [x.split("\t")[0] for x in rFile.read().splitlines()]
    toFilter = toFilter[~toFilter.index.isin(broken)]

    #Exclude those for which we don't have dynamic analysis
    # dynamicPath = os.path.join(DATASET_DIRECTORY,'pickles')
    # with open(dynamicPath) as rFile:
    #     dynamicPath = rFile.read().splitlines()
    # toFilter = toFilter[toFilter.index.isin(dynamicPath)]
    return toFilter

def excludeFamilies(toFilter):
    #Exclude broken samples
    brokenPath = os.path.join(DATASET_DIRECTORY,'exclude')
    with open(brokenPath) as rFile:
        exclude = rFile.read().splitlines()
    toFilter = toFilter[~toFilter.family.isin(exclude)]
    return toFilter

def buildLabelDataFrame(experiment,minSamples,excludePacked,binary):
    if binary:
        #Goodware (we do not need families here)
        print("Goodware...")
        goodware = os.listdir(GOODWARE_DIRECTORY)
        dataset = pd.DataFrame(index=goodware,columns = ['family','benign','set'])
        dataset.index.names = ['sha1']
        dataset['family'] = ''
        dataset['benign'] = True
        dataset['set'] = ''
        dataset['mb'] = 0
        dataset['error'] = ''
        print("A total of {} goodware have been considered".format(len(goodware)))
        #Check the size of each sample (this is useful for ngram extraction to avoid the pipeline being stuck with samples >50Mb)
        print("Collecting the size of each sample")
        for sample in tqdm(goodware):
            dataset.at[sample,'mb'] = int(os.path.getsize(os.path.join(GOODWARE_DIRECTORY,sample))/1048576)
        ############
        dataset['packed'] = False
        ###########
        malware = pd.read_pickle(os.path.join(DATASET_DIRECTORY,experiment.replace('binary','multiclass'),'labels.pickle'))
        malware = malware[malware.benign==False]
        familiesGrouped = malware.groupby('family')
        for roundNumber in tqdm(range(5)):
            toConcat = []
            toConcat.append(dataset)
            for _,familyGrouped in familiesGrouped:
                start = roundNumber*20
                end = start + 20
                toConcat.append(familyGrouped.iloc[start:end])
            currentDataset = pd.concat(toConcat)
            assert len(currentDataset[currentDataset.index.duplicated(keep='first')])==0

            #Exlude broken
            currentDataset = excludeBroken(currentDataset)
            currentDataset = split(currentDataset)

            #Saving
            filepath = os.path.join(DATASET_DIRECTORY,experiment,f'{roundNumber}','labels.pickle')
            currentDataset.to_pickle(filepath)
    else:
        #Malware
        print("Malware...")
        families = os.listdir(MALWARE_DIRECTORY)
        consideredFamilies = 0
        dataset = []
        print("Loading families")
        for family in tqdm(families):
            currentSamples = os.listdir(os.path.join(MALWARE_DIRECTORY,family))
            if len(currentSamples)>=minSamples:
                currentDataset = pd.DataFrame(index=currentSamples,columns = ['family','benign','set','mb'])
                currentDataset['family'] = family
                currentDataset['benign'] = False
                currentDataset['set'] = ''
                currentDataset['mb'] = 0
                currentDataset['error'] = ''
                for sample in currentSamples:
                    currentDataset.at[sample,'mb'] = int(os.path.getsize(os.path.join(MALWARE_DIRECTORY,family,sample))/1048576)
                currentDataset.index.names = ['sha1']
                dataset.append(currentDataset)
                consideredFamilies+=1
        print(f"A total of {consideredFamilies} malware families with {minSamples} samples have been considered")
        dataset = pd.concat(dataset)

        print(f"Exclude aliases or other families which are not recognized")
        dataset = excludeFamilies(dataset)
    
        #Exclude broken samples for which static analysis fails
        dataset = excludeBroken(dataset)

        families = list(set(dataset.family))
        #Balance families by using av class agreement
        avclass_agreement = pd.read_csv(AVCLASS_AGREEMENT,sep='\t',index_col='sha2',usecols=['sha2','all_avc2_families'])
        chunks = []
        print("Balancing remaining families")
        for family in tqdm(families):
            current = dataset[dataset.family==family]
            if len(current)<minSamples:
                continue
            elif len(current)==minSamples:
                chunks.append(current)
            else:
                #There are more than 100 samples. If they are more need to subsample them
                currentAgreement = avclass_agreement[avclass_agreement.index.isin(current.index)]
                if len(currentAgreement)<minSamples:
                    chunks.append(current.head(minSamples))
                else:
                    currentAgreement = currentAgreement.apply(evaluateAgreement,axis=1,args=(family,))
                    currentAgreement = currentAgreement.sort_values(ascending=False)
                    currentAgreement = currentAgreement.head(minSamples)
                    current = current[current.index.isin(currentAgreement.index)]
                    chunks.append(current)
        dataset = pd.concat(chunks)

    # #Check for packed samples here
    # print("Checking for packed samples")
    # packedInfo = pd.read_csv(os.path.join(PACK_INF_DIRECTORY,'result'),sep="\t",names=['sha1','packed']).set_index('sha1')
    # packedInfo['packed'] = packedInfo['packed'].apply(lambda x: True if x==x else False)
    # #Make sure that there are no duplicates 
    # assert len(packedInfo[packedInfo.index.duplicated(keep='first')])==0

    # dataset = dataset.merge(packedInfo,on='sha1',how='left')
    # assert dataset.packed.isna().sum() == 0

    # if excludePacked:
    #     dataset = dataset[~dataset.packed]

        # backward compatibility
        ############
        dataset['packed'] = False
        ###########

        #Make sure that there are no duplicates as this means that a single sample has been classified in multiple families or as a goodware
        assert len(dataset[dataset.index.duplicated(keep='first')])==0
        dataset = split(dataset)

        print('Creating Symbolic links')
        familiesGrouped = dataset.groupby('family')
        p_map(createSymbolic,familiesGrouped,num_cpus=CORES)

        #Saving
        print("Saving labels...")
        filepath = os.path.join(DATASET_DIRECTORY,experiment,'labels.pickle')
        dataset.to_pickle(filepath)
    print("Done!")
